import React from "react";
import style from "./BodyBlock.module.css";

function BodyBlock() {
  return (
    <div className={style.body}>
      <div className={style.list}>
        <ul>
          <li><NavLink to="/">Normal</NavLink> </li>
          <li><NavLink to="/">Good</NavLink> </li>
          <li><NavLink href="/">Busy</NavLink> </li>
          <li><NavLink href="/">Hot</NavLink> </li>
          <li><NavLink href="/">Upkeep</NavLink> </li>
        </ul>
      </div>
    </div>
  );
}

export default BodyBlock;
